
DROP TABLES IF EXISTS TempNames, TempNumbers, TempISBN, TempDescriptions, TempStreet, TempAdresses, TempOpinions, TempTitles, TempDates, TempPrices, TempDateTimes;

CREATE TABLE IF NOT EXISTS TempNames(
imie varchar(30) NOT NULL,
nazwisko varchar(30) NOT NULL
);




CREATE TABLE IF NOT EXISTS TempNumbers(
phone varchar(20) NOT NULL
);




CREATE TABLE IF NOT EXISTS TempDescriptions(
description text NOT NULL
);




CREATE TABLE IF NOT EXISTS TempOpinions(
tekst text NOT NULL
);




CREATE TABLE IF NOT EXISTS TempISBN(
ISBN char(13) NOT NULL
);




CREATE TABLE IF NOT EXISTS TempAdresses(
street varchar(50) NOT NULL,
city varchar(40) NOT NULL
);




CREATE TABLE IF NOT EXISTS TempTitles(
title varchar(50) NOT NULL
);




CREATE TABLE IF NOT EXISTS TempDates(
datee date NOT NULL
);



CREATE TABLE IF NOT EXISTS TempPrices(
price decimal(10, 2) NOT NULL
);




CREATE TABLE IF NOT EXISTS TempDateTimes(
datee datetime NOT NULL
);



